/* eslint-disable prettier/prettier */
import React, { useState, useEffect } from 'react';
import { useObserver } from 'mobx-react-lite';
import { withRouter } from 'react-router-dom';
import { Box,Button } from '@material-ui/core'; //Button
import useStores from '@stores/useStores';
import FormControl from '@material-ui/core/FormControl';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputLabel from '@material-ui/core/InputLabel';
import GetSearch from 'pages/popups/GetSearch';
import GetSearch2 from 'pages/popups/GetSearch2';
import GetSearch3 from 'pages/popups/GetSearch3';
import HighlightOffIcon from '@material-ui/icons/HighlightOff';
import { IconButton } from '@material-ui/core';
import axios from 'axios';
import FinalSelect from 'pages/popups/FinalSelect';
// import axios from 'axios';



const Lookup = () => {
    const [visible, setVisible] = useState(false);
    const [visible2, setVisible2] = useState(false);
    const [visible3, setVisible3] = useState(false);
    const [visible4, setVisible4] = useState(false);
    const { commonStore } = useStores();
    const [subclass, setSubclass] = useState(null);
    const [part, setPart] = useState(null);
    const [type, setType] = useState(null);
    const [rating, setRating] = useState(null);
    const [size, setSize] = useState(null);
    const [seat, setSeat] = useState(null);
    const [stem, setStem] = useState(null);
    const [bore, setBore] = useState(null);
    const [stgrade, setStgrade] = useState(null);
    const [disc, setDisc] = useState(null);
    const [special, setSpecial] = useState(null);
    const [end, setEnd] = useState(null);
    const [body, setBody] = useState(null);

    const [resetHandle, setResetHandle] = useState(false);
    const [iconHandle, setIconHandle] = useState(false);

    const IconShow =()=>{
      setIconHandle(!iconHandle);
    }

    const HandleShow =() =>{
      setResetHandle(!resetHandle)
    }

    const {$Dim, $setAlert} = useObserver(() => ({
        $Dim: commonStore.Dim,
        $Confirm: commonStore.Confirm,
        $setConfirm: commonStore.fSetConfirm,
        $setConfirmFunc: commonStore.fSetConfirmFunc,
        $setAlert: commonStore.fSetAlert,
      }));

      const fAlert = () => {
        $setAlert({ visible: true, desc: '데이터가 부족합니다.' });
        return;
      };

      const finalBtn =() =>{
        if(stgrade !== null || body!== null){
          setVisible4(true)
        }else{
          fAlert();
        }
        setVisible4(true)
      }
      const Styles = fStyles($Dim);
      // useEffect(()=>{
      // },[visible])
      // console.log(part);
      const  aaa = async() =>{

        console.log(1,subclass.Minorcd)
        console.log(2,part.Minorcd)
        console.log(3,type.Minorcd)
        console.log(4,rating.Minorcd)
        console.log(5,size.Minorcd)
        console.log(6,stgrade.Minorcd)
        
      }
      console.log(77,stem);

      const onReset = () =>{
        setSubclass(null);
        setPart(null);
        setType(null);
        setRating(null);
        setSize(null);
        setSeat(null);
        setStem(null);
        setBore(null);
        setStgrade(null);
        setDisc(null);
        setSpecial(null);
        setEnd(null);
        setBody(null);
        HandleShow();
      }

      useEffect(()=>{
        onReset()
      },[])

      const clickHandle = () =>{
        console.log('여기여기여기1');
        if (body !== null) {
          console.log('여기여기여기10');
          setBody(null);
        } 
        else if (end !== null) {
          setEnd(null);
        } 
        else if (stgrade === null && size !== null) {
          setSize(null);
          console.log('핫')
        }
        else if (bore !== null) {
          setBore(null);
        } 
        else if (stgrade === null && rating !== null) {
          setRating(null);
          console.log('스')
        }
        else if (special !== null) {
          setSpecial(null);
        } else if (disc !== null) {
          setDisc(null);
        } else if (stem !== null) {
          setStem(null);
        } else if (seat !== null) {
          setSeat(null);
        } else if (stgrade !== null) {
          setStgrade(null);
        }
          else if (size !== null) {
          setSize(null);
        } else if (rating !== null) {
          setRating(null);
          console.log('르')
        } else if (type !== null) {
          setType(null);
        } else if (part !== null) {
          setPart(null);
          console.log('여기여기여기2');
        } else if (subclass !== null) {
          setSubclass(null);
          console.log('여기여기여기3');
        }
        IconShow();
      }
    return (
      <>
        
        <Box style={Styles.s1} display="flex" flexDirection="column" alignItems="center">
          <Box style={{height: $Dim * 30 }} />
          <Box style={{ width: $Dim * 550, height: $Dim * 20, marginTop: $Dim * 20  }} display="flex" flexDirection="column" alignItems="center">
            <Box style={{display:'flex', justifyContent:'space-around'}}>
              <Button variant="contained" style={{backgroundColor: 'red',marginRight:$Dim * 5 ,color: '#ffffff'}} onClick={onReset}>초기화</Button>
              <Button variant="contained" style={{backgroundColor: '#348fe2',marginRight:$Dim * 5,color: '#ffffff'}} onClick={finalBtn}>품번확인</Button>
            </Box>
          </Box>
        
          <Box style={{ width: $Dim * 550, height: $Dim * 200, marginTop: $Dim * 20  }} display="flex" flexDirection="column" alignItems="center" justifyContent="flex-end">
            <Box style={{fontSize:$Dim*10, alignItems:"center"}}>
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>소분류 :</div>
                <FormControl disabled onClick={()=>{subclass === null && setVisible(true)}} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel htmlFor="outlined-adornment-amount">{subclass !== null && subclass.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                {subclass && !part &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div>
              {subclass !== null && 
              <div style={{display: 'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>반제품 PART :</div>
                <FormControl disabled onClick={()=>part === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel htmlFor="outlined-adornment-amount">{part !== null && part.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                {part && !type && !seat &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div>}
              
              {part !== null ? part.Remark !== 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>반제품 TYPE :</div>
                <FormControl disabled onClick={()=>type === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{type !== null && type.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { type && !rating &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>SEAT :</div>
                <FormControl disabled onClick={()=>seat === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{seat !== null && seat.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { seat && !stem &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>BD-BT & STEM :</div>
                <FormControl disabled onClick={()=>stem === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{stem !== null && stem.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { stem && !disc &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>DISC :</div>
                <FormControl disabled onClick={()=>disc === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{disc !== null && disc.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { disc && !special &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>SPECIAL CLASS :</div>
                <FormControl disabled onClick={()=>special === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{special !== null && special.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { special && !rating &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>RATING CLASS :</div>
                <FormControl disabled onClick={()=>rating === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{rating !== null && rating.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { rating && !size && !bore &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div>}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>BORE :</div>
                <FormControl disabled onClick={()=>bore === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{bore !== null && bore.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { bore && !size &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>SIZE :</div>
                <FormControl disabled onClick={()=>size === null && setVisible2(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{size !== null ?size.Minornm:null}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { size && !stgrade && !end &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div>}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>END :</div>
                <FormControl disabled onClick={()=>end === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{end !== null && end.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { end && !body &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark === 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>BODY MATERIAL :</div>
                <FormControl disabled onClick={()=>body === null && setVisible(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{body !== null && body.Minornm}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { body &&<IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
              </div> : null}
              {part !== null ? part.Remark !== 'BD' &&
              <div style={{display:'flex', marginBottom:15}}>
                <div style={{marginTop:15,marginRight:10}}>강종 :</div>
                <FormControl disabled onClick={()=>stgrade === null && setVisible3(true)} fullWidth variant="outlined" style={{width:$Dim*400}}>
                  <InputLabel disabled htmlFor="outlined-adornment-amount">{stgrade !== null ? stgrade.Minornm:null}</InputLabel>
                  <OutlinedInput id="outlined-adornment-amount" labelWidth={60} />
                </FormControl>
                { stgrade && <IconButton onClick={clickHandle}><HighlightOffIcon fontSize='large'/></IconButton>}
